import React, { useState, useEffect } from 'react';
import './App.css';

function App() {
  const message = "hello sir"

  const [wiches, setwiches] = useState([])
  fetch('/getwich')
    .then(response => response.json())
    .then(data => setwiches(data))

  if (wiches.length == 0) {
    return (
      <div id="not-loading">
        <p>Not loading. Please refresh or try again later</p>
      </div>
    )
  }
  return (
    <div className="App">
        <p>{message}</p>
    </div>
  );
}

export default App;
